export default function BlackGray ({
  type, num, fontSize
}) {

  let tit = [
    <><strong>닉네임</strong><span>을 입력해주세요</span></>,
    <><strong>활발한 매칭</strong><span>을 위해</span><br/><strong>입장 나이</strong><span>를</span><strong>제한</strong></>,
 
  ]
  
  let style = {
    textAlign : 'center'
  }

  let fontStyle = {
    fontSize : type == "normal" ? '24px' : type == "small" ? '16px' : '12px'
  }
  

  return (
    <div style={style}>
      <span style={fontStyle}>{tit[num]}</span>
    </div>
  )
}
